      '++LotusScript Development Environment:2:5:(Options):0:66
      Option Public
      Option Explicit
      Use "enhLogClassLite" 
      
      
      
      '++LotusScript Development Environment:2:5:(Forward):0:1
      Declare Function getHTMLstyle() As NotesRichTextStyle 
      Declare Function getXSL() As NotesStream 
      
      '++LotusScript Development Environment:2:5:(Declarations):0:2
      Const FORM_PREFIX = |Form: Log Entry.|
      Dim filepath As String
      
      
      '++LotusScript Development Environment:2:1:getHTMLstyle:1:8
      Function getHTMLstyle() As NotesRichTextStyle 
      	Dim extendedInfo As String
      	Static result As NotesRichTextStyle
      	On Error Goto ErrorTrap
      	
      	If (result Is Nothing) Then 
      		Set result = getCurrentSession().CreateRichTextStyle()
      		result.PassThruHTML = True
      	End If ' (result Is Nothing)
      	
      ExitPoint:
      	Set getHTMLstyle = result
      	Exit Function
      ErrorTrap:
      	On Error Goto 0
      	enhLogException FORM_PREFIX, extendedInfo$
      	Set result = Nothing
      	Resume ExitPoint 
      End Function ' getHTMLstyle 
      '++LotusScript Development Environment:2:1:getXSL:1:8
      Function getXSL() As NotesStream 
      	On Error Goto ErrorTrap
      	
      	Dim extendedInfo As String
      	Dim result As NotesStream 
      	
      	Set result = getCurrentSession().CreateStream() 
      	Call result.WriteText(|<?xml version="1.0" encoding="ISO-8859-1"?>
